import React from 'react';
import'./style.css';


const FullPost = (props) => {
  return(
    <div>
      <div class="heading" id="navbar">
        <span class="heading-vertical">The</span>
        <h1 class="heading-bold">Siren</h1>
        <button class="btn">Let Started</button>
      </div>
    </div>
  )
}
export default FullPost;
